import React from 'react'

const MusicTable = (props) => {
    return (
        <table className="table">
            <thead>
                <tr>
                    <th>Title</th>
                    <th>Artist</th>
                    <th>Album</th>
                    <th>Release Date</th>
                    <th>Like</th>
                    <th>Delete</th>
                </tr>
            </thead>
            {props.mapMusic()}<button>delete</button>
        </table>
    );
}

export default MusicTable;
